            "subkey": "1pNyW8QaPA37fCgu96KdwUbFz0gwz5ESScjmcyo7G8Kh",
            "summary": "Apples AirPods kicked off the wireless earbud trend and remain among the best-in-class to this day. Good news! Apple kicked off some price cuts just in time for summer and you can snag a new pair of AirPods for as little as $99one of the lowest prices ever. The second-gen AirPods can be yours for just $99 on Amazon , a solid $30 discount on the usual price. Theyre missing some of the features found on the next-gen models (such as Spatial Audio with dynamic head tracking and water resistance), but remain fantastic earbuds, especially at this cut-rate price. If you want those extra goodies, the third-gen AirPods are on sale for $159 . Thats a mere $10 discount, but may be worth the money for discerning listeners, as our pals at Macworld say the newer model offers better sound, longer battery life, and a more refined design. Finally, if youre looking for the best possible audio (and stellar active noise cancellation ) out of your Apple earbuds, the second-gen AirPods Pro are on sale for $199 a much more tangible $50 discount.",
