            "summary": "Unique partnership includes TELUS commitment to construct cell towers and provide workforce development for Nisga''a Nation members NEW AIYANSH, BC , June 1, 2023 /CNW/ - Today, the Nisga''a Lisims Government celebrates a new partnership to bring wireless connectivity to all four Nisga''a villages in Northwest B.C., improving safety and supporting Indigenous prosperity in the Nass Valley through a first-of-its-kind agreement with TELUS. Once the $8.8-million project is complete in 2024, more than 800 residential customers and local businesses will gain access to TELUS high-speed wireless coverage on Nisga''a Nation-owned network, providing reliable connectivity for residents of all four villages of Gingolx, Laxgalts''ap, Gitwinksihlkw, and New Aiyansh, expanding access to healthcare and telemedicine, which is currently limited for Nisga''a citizens and health clinics on Nisga''a Lands, and improving public safety and communication for travelers and emergency responders along a previously unconnected stretch of Highway 113.",
